function App() {
  const num = 3;
  const rest = 10;

  return (
    <>
      <h1> Workout Timer</h1>
      <div style={{ height: "20em", width: "25em", backgroundColor: "red", textAlign: "center", display: "flex", flexDirection: "column", justifyContent: "center" }}>
        <i>{num} sets of workout with {rest}s rest in between</i>
        <b style={{ fontSize: "2.5em" }}>00 : 00</b>
      </div>
    </>
  );
}

export default App;
